Brendon Miller, Carmen Valentina, Charley Chase, Devon Lee, Diamond Kitty, Jack Vegas, Marcus London, Sarah Vandella, Stormy Daniels, Tommy Gunn

After his drug shipment goes missing, drug dealer Ricardo Valdez (Jack Vegas) and wife Lydia (Stormy Daniels), enlist a law enforcement insider\'s help in tracking down what went wrong. Motorcycle gang member Cade (Brendon Miller), has hijacked the shipment in order to blackmail Ricardo into becoming partners with his gang (The Sinners), and double their territory in the process. In a twist of fate, Lydia unwittingly falls for Cade who is actually undercover FBI tasked with bringing down both The Sinners, and Ricardo\'s cartel. Join multiple award winning director/writer/performer Stormy Daniels in this action packed adventure. Exotic locations, outstanding performances and an all star cast make Blow a not to be missed instant classic!
